import MODAL_TYPE_ENUM from "common/enumerators/ModalTypeEnum"
import { NFE_KEY } from "common/model/Notification"
import { MDFE_KEY } from "common/model/Notification"

export default function WarningDfe({ data, toggleModalOn, toggleFetchData}) {

    const handleClick = () => {
      toggleModalOn(MODAL_TYPE_ENUM.WARNING_DFE, data)
      toggleFetchData()
    }

    if (data[MDFE_KEY]) {
      return (
        <div
          className={"underlined_text"}
          onClick={handleClick}
          style={{ textAlign: 'center', cursor: "pointer", color: '#2322c8' }}
        >
          MDFe
        </div>
      )
    } else if (data[NFE_KEY]) {
      return (
        <div
          className={"underlined_text"}
          onClick={handleClick}
          style={{ textAlign: 'center', cursor: "pointer", color: '#2322c8' }}
        >
          NFe
        </div>
      )
    }

    return "SEM DFe"
  }
